  public static String category(int codePoint)
  {
    int l = 0;
    int r = _START_.length-1;
    while (l <= r)
      {
        int m = (l + r) / 2;
        if      (_START_[m] > codePoint) { r = m - 1; }
        else if (_END_  [m] < codePoint) { l = m + 1; }
        else
          {
            return _CATEGORY_[m];
          }
      }
    return "Cn";
  }

